import { Switch, Route, Redirect } from "react-router-dom";


// components
import Sidebar from "../components/Sidebar/sidebar";

// views
import Dashboard from "../views/Admin/Dashboard";
import SickLeave from "../views/Admin/Sickleave"
import Tables from "../views/Admin/TableTimeAttendace"
import Otherleave from "../views/Admin/Otherleave"


export default function Admin() {
    return(
        <>
            <Sidebar />
            <div className="relative md:ml-64 bg-gray-100">               
                        <Switch>
                            <Route path="/admin/dashboard" exact component={Dashboard} />
                            <Route path="/admin/sickleave" exact component={Sickleave} />
                            <Route path="/admin/tables" exact component={Tables} />
                        </Switch>

            </div>
        </>
    )
}
